'use strict';

app.directive('dbSlides', 
	['$animate', 
	function ($animate) {
		return {
			scope:{

			},
			restrict:'EA',

			controller:function($scope){

			$animate.enabled(false);
			$('.carousel').carousel({
			  interval: 10000
			});

			$scope.slidePicture = {};
			$scope.slidePicture.anne = "data:image/png;base64,"
			$scope.slidePicture.tina = "data:image/jpeg;base64,"

			},
			templateUrl: '../templates/slides.html'
		};
	}]
);
